import React, { Component } from "react";
import './Project.css';

class Project extends Component {
	render() {
   		const { params } = this.props.match;
    return (
      <div className="Project">


           <h1>{params}</h1>

	       <p>{this.props.body}</p>
	  </div>
    );
  }
}

export default Project;
